import React, { useState } from "react";
import AppLayout from "../components/AppLayout";
import Head from "next/head"
import { Input, Form, Checkbox, Button } from "antd";


const Signup = () => {

  const onSubmit = () => {};

  const onChangeId = () => {};

  const onChangeNick = () => {};

  const onChangePassword = () => {};

  const onChangePasswordChk = () => {};

  const onChangeTerm = () => {};

  return (
    <>
      <Head>
        <title>NodeBird</title>
        <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.25.3/antd.css" />
      </Head>
      <AppLayout>
        <Form onSubmit={onSubmit} style={{ padding: 10 }}>
          <div>
            <label htmlFor="user-id">아이디</label>
            <br/>
            {/* value와 on */}
            <Input name="user-id" required onChange={onChangeId} />
          </div>
          <div>
            <label htmlFor="user-nick">닉네임</label>
            <br />
            <Input name="user-nick" required onChange={onChangeNick} />
          </div>
          <div>
            <label htmlFor="user-id">비밀번호</label>
            <br />
            <Input name="user-id" required onChange={onChangePassword} />
          </div>
          <div>
            <label htmlFor="user-id">비밀번호 체크</label>
            <br />
            <Input name="user-id" required onChange={onChangePasswordChk} />
          </div>
          <div>
            <Checkbox name="user-term" onChange={onChangeTerm}>말을 잘 들을 것을 맹세합니다</Checkbox>
          </div>
          <div>
            <Button type="primary" htmlType="submit">가입하기</Button>
          </div>
        </Form>
      </AppLayout>
    </>
  );
};

export default Signup;
